import React from 'react';

function LeftArea () {
  return <div>뽀킹어썸 리액트</div>;
}

function Contents(){
  return <div>이거슨 메인</div>;
}

function App() {
  return(
      <div>
        <LeftArea />
        <Contents />
      </div>
    );
}

export default App;
